    void UpdatePID()
    {
      common::Time current_time = this->model_->GetWorld()->GetSimTime();
      if (k_ == 0)
      {
        
        myfile1.open("footR_3.csv");
        myfile2.open("kneeR_3.csv");
        myfile3.open("hipPr_3.csv");
//        myfile4.open("wrist_1.csv");
//        myfile5.open("gripper_1.csv");
       }
      k_ = k_ + 1 ;
      double error;
      double dt    = current_time.Double()
                   - this->last_update_time_.Double();

          shoulder_l(0,dt);
          high_arm_l(0,dt);
          low_arm_l(0,dt);
          wrist_l(0,dt);
          gripper_l(0,dt);

          shoulder_r(0,dt);
          high_arm_r(0,dt);
          low_arm_r(0,dt);
          wrist_r(0,dt);
          gripper_r(0,dt);
          pan_head(0.0,dt);
          tilt_head(0.0,dt);

          pelvis_l(0.0,dt);
          pelvis_r(0.0,dt);


        if (x1<1)
        {
          footl = lip(x1,xp,footl_loc);
          footr = lip(x1,xp,footr_loc);
          kneel = lip(x1,xp,kneel_loc);
          kneer = lip(x1,xp,kneer_loc);
          hipPl = lip(x1,xp,hipPl_loc);
          hipPr = lip(x1,xp,hipPr_loc);


          ankle1_l(footl,dt);
          ankle1_r(footr,dt);
          tibia_l(kneel,dt);
          tibia_r(kneer,dt);
          thigh2_l(hipPl,dt);
          thigh2_r(hipPr,dt);

          ankle2_l(0.0,dt);
          ankle2_r(0.0,dt);
          thigh1_l(0.0,dt);
          thigh1_r(0.0,dt);

        }
        else
        {
          footl = lip(x1,xp,footl_loc);
          footr = lip(x1,xp,footr_loc);
          kneel = lip(x1,xp,kneel_loc);
          kneer = lip(x1,xp,kneer_loc);
          hipPl = lip(x1,xp,hipPl_loc);
          hipPr = lip(x1,xp,hipPr_loc);

          // hip swing movement
          anklel = lip(x1,xp,anklel_loc);
          ankler = lip(x1,xp,ankler_loc);
          hipRl = lip(x1,xp,hipRl_loc);
          hipRr = lip(x1,xp,hipRr_loc);          



          ankle2_l(anklel,dt);
          ankle2_r(ankler,dt);
          ankle1_l(footl,dt);
          ankle1_r(footr,dt);
          tibia_l(kneel,dt);
          tibia_r(kneer,dt);
          thigh2_l(hipPl,dt);
          thigh2_r(hipPr,dt);
          thigh1_l(hipRl,dt);
          thigh1_r(hipRr,dt);

          myfile1 << footr << "," << this->ankle1_r_joint_->GetAngle(0).Radian() << "\n";
  	  myfile2 << kneer << "," << this->tibia_r_joint_->GetAngle(0).Radian() << "\n";
          myfile3 << hipPr << "," << this->thigh2_r_joint_->GetAngle(0).Radian() << "\n";

        }


      if ((x1>501)&&(x1<501.1))
       {std::cout << "I just took" << stepCount << "steps\n";
        stepCount = stepCount +1;
        // this line determines how many steps the darwin takes
        if (stepCount < 16)
          {x1 = 301;}}
      if (x1<1)
       x1 = x1 + 0.001;
      else if ((x1+0.1)<502)
       x1 = x1 + 0.1;
      else if ((x1+0.1)<801)
       x1 = x1 + 0.1;
      else if ((x1+0.001)<802)
       x1 = x1 + 0.001;
      else
       x1 = 801.999;


      this->last_update_time_ = current_time;

    }

float lip(float x,float xp[],float yp[])
{
  float y;
  float xp0;
  float yp0;
  float xp1;
  float yp1;
  for (int i =0; i<=803; i++)
  {
    if (xp[i]<=x)
    {
      xp0 = xp[i];
      yp0 = yp[i];
    }
    if (xp[i]>x)
    {
      xp1 = xp[i];
      yp1 = yp[i];
      break;
    }
  }
//  gzdbg << "xp0:{" << xp0  << "} \n";
//  gzdbg << "xp1:{" << xp1  << "} \n";
//  gzdbg << "yp0:{" << yp0  << "} \n";
//  gzdbg << "yp1:{" << yp1  << "} \n";
  float m = (yp1-yp0)/(xp1-xp0);
  y = (yp0 +(m*(x-xp0)));
  return (y);
}

